import { Redirect, Route } from "react-router-dom";

const PrivateRoute = ({ component: Component, ...rest }) => {
  console.log(typeof localStorage.getItem("authToken") !== 'undefined'  );
  return (
    <Route
      {...rest}
      render={(props) =>
        typeof localStorage.getItem("authToken") != undefined ? (
          <Component {...props} />
        ) : (
          <Redirect to="/login" />
        )
      }
    />
  );
};

export default PrivateRoute;
